import React, { Fragment, Component } from "react";
import { connect } from "react-redux";
import {
  Fab,
  Dialog,
  DialogContent,
  DialogContentText,
  DialogTitle
} from "@material-ui/core";
import { Add } from "@material-ui/icons";
import { getValues } from "../../../redux/actions/valuesActions";
import Form from "./Form";

class AddDialog extends Component {
  state = {
    open: false
  };

  handleToggle = () => {
    this.setState({
      open: !this.state.open
    });
  };

  render() {
    const { open } = this.state;
    return (
      <Fragment>
        <Fab size="small" color="secondary" onClick={this.handleToggle}>
          <Add />
        </Fab>
        <Dialog open={open} onClose={this.handleToggle}>
          <DialogContent>
            <DialogTitle>Add A Disc</DialogTitle>
            <DialogContentText>
              Please fill out the form below
            </DialogContentText>
            <Form />
          </DialogContent>
        </Dialog>
      </Fragment>
    );
  }
}

const mapStateToProps = state => ({
  discs: state.discs,
  values: state.values
});

export default connect(mapStateToProps)(withStyles(styles)(AddDialog));
